//Replace and insert number to startIndex for every value.
void RecursiveInsert(string key, char value, int startIndex)
{
    //Input that does not have that number (probably imposible) is skipped.
    if (!input.Contains(key)) return;
    
    int startIndexOfNumberWord = input.IndexOf(key, startIndex, StringComparison.Ordinal);
    //If number word is found but we already searched all and after the startIndex there is none numberWord. Returns -1.
    if (startIndexOfNumberWord == -1) return;
    //Insert the number character to the input. Later we do the solution looping with same tactic.
    input = input.Insert(startIndexOfNumberWord + 1, value.ToString());
    //We insert a character so +1 and we dont want to make index same character. We need to check after the character. So +2.
    startIndex = startIndexOfNumberWord + 2;
    
    //Recursive.
    RecursiveInsert(key, value, startIndex);
}